import React from 'react';

// Define your styles as objects
const footerStyle = {
  display: 'flex',
  justifyContent: 'space-around',
  padding: '20px',
  background: '#f5f5f5',
  color: '#333',
  flexWrap: 'wrap' // Allow the footer to wrap on smaller screens
};

const columnStyle = {
  display: 'flex',
  flexDirection: 'column',
  maxWidth: '200px', // Set a max-width for each column to ensure they fit on smaller screens
  flexBasis: '100%', // This makes sure that the columns take full width on mobile screens
  boxSizing: 'border-box' // Include padding and border in the element's total width and height
};

const titleStyle = {
  fontSize: '1.25rem',
  marginBottom: '0.5rem'
};

const listStyle = {
  listStyle: 'none',
  padding: 0
};

const listItemStyle = {
  marginBottom: '0.25rem',
  cursor: 'pointer'
};

const linkStyle = {
  textDecoration: 'none',
  color: 'inherit' // This makes the color inherit from the parent, which is set to #333
};

// Update your component
const Footer = () => {
  return (
    <footer style={footerStyle}>
      <div style={columnStyle}>
        <h3 style={titleStyle}>MyTravaly</h3>
        <ul style={listStyle}>
          <li style={listItemStyle}><a href="/company-details" style={linkStyle}>Company Details</a></li>
          <li style={listItemStyle}><a href="/career" style={linkStyle}>Career</a></li>
          <li style={listItemStyle}><a href="/terms" style={linkStyle}>Terms & Conditions</a></li>
          <li style={listItemStyle}><a href="/privacy" style={linkStyle}>Privacy Policy</a></li>
          <li style={listItemStyle}><a href="/contact" style={linkStyle}>Contact us</a></li>
        </ul>
      </div>
      <div style={columnStyle}>
        <h3 style={titleStyle}>Reservations Centre</h3>
        <ul style={listStyle}>
          <li style={listItemStyle}><a href="/helpdesk" style={linkStyle}>Helpdesk</a></li>
          <li style={listItemStyle}><a href="/make-reservation" style={linkStyle}>Make a Reservation</a></li>
          <li style={listItemStyle}><a href="/guest-policy" style={linkStyle}>Guest Bookings Policy</a></li>
          <li style={listItemStyle}><a href="/get-app" style={linkStyle}>Get the App</a></li>
          <li style={listItemStyle}><a href="/trust-safety" style={linkStyle}>Trust and Safety</a></li>
        </ul>
      </div>
      <div style={columnStyle}>
        <h3 style={titleStyle}>Hotel Business Centre</h3>
        <ul style={listStyle}>
          <li style={listItemStyle}><a href="/add-hotel" style={linkStyle}>Add Hotel</a></li>
          <li style={listItemStyle}><a href="/resources" style={linkStyle}>Resources</a></li>
          <li style={listItemStyle}><a href="/connectivity-centre" style={linkStyle}>Connectivity Centre</a></li>
          <li style={listItemStyle}><a href="/business-policy" style={linkStyle}>Business Policy</a></li>
          <li style={listItemStyle}><a href="/cyber-security" style={linkStyle}>Cyber Security & Awareness</a></li>
        </ul>
      </div>
    </footer>
  );
};

export default Footer;
